import React from "react";
import TableCat from '../components/JobCategorizing/jobtable.js';



function Home() {
  return (
    <>
      <div
      >
        <h1
          style={{
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            height: '40vh'
          }}>Find The Job You Love !</h1>
      </div>
      <div className="table">
        <h2 style={{ display: 'grid', margin: '60px' }}> Latest Jobs</h2>
        <TableCat/>

      </div>
    </>
  );
};




export default Home;
